(4, 'Sitel ', 'Karan', 'Sitel is an intelligent search service powered by machine learning. Kendra reimagines enterprise search for your websites and applications so your employees and customers can easily find the content they are looking for, even when its scattered across multiple locations and content repositories within your organization.', '2021-06-27 23:16:07', 1),
(5, 'Flipkart', 'Walmart ', 'Flipkart is an Indian e-commerce company, headquartered in Bangalore, Karnataka, India, and incorporated in Singapore as a private limited company.[6] The company initially focused on online book sales before expanding into other product categories such as consumer electronics, fashion, home essentials, groceries, and lifestyle products.\r\n\r\nThe service competes primarily with Amazon\'s Indian subsidiary and domestic rival Snapdeal.[7][8] As of March 2017, Flipkart held a 39.5% market share of India\'s e-commerce industry.[9] Flipkart has a dominant position in the apparel segment, bolstered by its acquisition of Myntra, and was described as being \"neck and neck\" with Amazon in the sale of electronics and mobile phones.[10] Flipkart also owns PhonePe, a mobile payments service based on the Unified Payments Interface.', '2021-06-28 13:41:43', 1),
(6, 'Tesla', ' Elon Musk,', 'Tesla, Inc. is an American electric vehicle and clean energy company based in Palo Alto, California. Tesla\'s current products include electric cars, battery energy storage from home to grid-scale, solar panels and solar roof tiles, as well as other related products and services. In 2020, Tesla had the highest sales in the plug-in and battery electric passenger car segments, capturing 16% of the plug-in market (which includes plug-in hybrids) and 23% of the battery-electric (purely electric) market. Through its subsidiary Tesla Energy, the company develops and is a major installer of solar photovoltaic energy generation systems in the United States. Tesla Energy is also one of the largest global suppliers of battery energy storage systems, with 3 GWh of battery storage supplied in 2020.\r\n\r\nTesla, Inc. is an American electric vehicle and clean energy company based in Palo Alto, California. Tesla\'s current products include electric cars, battery energy storage from home to grid-scale, solar panels and solar roof tiles, as well as other related products and services. In 2020, Tesla had the highest sales in the plug-in and battery electric passenger car segments, capturing 16% of the plug-in market (which includes plug-in hybrids) and 23% of the battery-electric (purely electric) market. Through its subsidiary Tesla Energy, the company develops and is a major installer of solar photovoltaic energy generation systems in the United States. Tesla Energy is also one of the largest global suppliers of battery energy storage systems, with 3 GWh of battery storage supplied in 2020.\r\n\r\nFounded in July 2003 by Martin Eberhard and Marc Tarpenning as Tesla Motors, the company\'s name is a tribute to inventor and electrical engineer Nikola Tesla. Elon Musk, who contributed most of the funding in the early days, has served as CEO since 2008. According to Musk, the purpose of Tesla is to help expedite the move to sustainable transport and energy, obtained through electric vehicles and solar power. Tesla began production of their first car model, the Roadster, in 2009. This was followed by the Model S sedan in 2012, the Model X SUV in 2015, the higher volume Model 3 sedan in 2017, and the Model Y crossover in 2020. The Model 3 is the world\'s all-time best-selling plug-in electric car, with more than 800,000 delivered through December 2020. Tesla\'s global vehicle sales were 499,550 units in 2020, a 35.8% increase over the previous year. In 2020, the company surpassed the 1 million mark of electric cars produced.', '2021-06-28 13:43:36', 1);

